import { Button,Container,Dropdown, Row, Col} from 'reactstrap';
import "bootstrap/dist/css/bootstrap.min.css";
import "./Div_hide.css"




   
function Card() {
  return (
       <div >
           <Row id="id_1">
              this is row 1
           </Row>
           <Row id="id_2">
           <a>hello </a>
           </Row>
           <Row id="id_3">
               row_3

           </Row>
           
      
      </div> 
    
  );
}
   
export default function Div_hide() {
  return (
    <div>
      <Card/>  
    </div>
  );
}
